export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:e,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:e,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:e,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},cL8hw5Fq7c:{data:{id:1303,attributes:{imdbId:"tt0077632",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjcyYzc5ZTEtMGYxOC00ZmQxLWIyMzYtNDEyYjg0MmU3NzMyXkEyXkFqcGdeQXVyNzg1MTM4NA@@._V1_SX300.jpg",type:e,ratings:[{Source:"Internet Movie Database",Value:"5.9\u002F10"}],item_lang:{data:{id:1966,attributes:{title:i,plot:"A young boy has great fun conning his family, friends, and neighbors.",slug:"the-great-brain"}}},books:{data:[{id:7092,attributes:{title:i,description:"This first book in the series is a great combination of The Adventures of Tom Sawyer and The Terrible Two series, and is perfect for fans of Roald Dahl. The best con man in the Midwest is only ten years old. Tom, a.k.a., the Great Brain, is a silver-tongued genius with a knack for turning a profit. When the Jenkins boys get lost in Skeleton Cave, the Great Brain saves the day. Whether it's saving the kids at school, or helping out Peg-leg Andy, or Basil, the new kid at school, the Great Brain always manages to come out on top-and line his pockets in the process.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8DhiDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:b,publisher:c,subtitle:d}},{id:7093,attributes:{title:"The Return of the Great Brain",description:"This sixth book in the series is a great combination of The Adventures of Tom Sawyer and The Terrible Two series, and is perfect for fans of Roald Dahl. Tom Fitzgerald, better known as the Great Brain, is struggling to stay reformed now that his friends have threatened to shut him out if he pulls even one more swindle. But his younger brother J.D. knows Tom's reformation makes for a dull life, and is not altogether unhappy--or blameless--when his brother's money-loving heart stealthily retums to business as usual.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eDViDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:f,published:b,publisher:c,subtitle:d}},{id:7094,attributes:{title:"The Great Brain Reforms",description:"This fifth book in the series is a great combination of The Adventures of Tom Sawyer and The Terrible Two series, and is perfect for fans of Roald Dahl. It's summer vacation, and J. D. is determined to reform his older brother Tom, a.k.a. the Great Brain, from his money swindling ways for good.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UzViDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:f,published:b,publisher:c,subtitle:d}},{id:7095,attributes:{title:"The Great Brain Is Back",description:"This classic trickster is back again, and he's up to no good in his eighth and final book of the series. Great mix of The Adventures of Tom Sawyer and The Terrible Two series, and is perfect for fans of Roald Dahl. Tom D. Fitzgerald--better known as The Great Brain--has turned thirteen, and pretty Polly Reagan has put a spell on him. But when it comes to swindling his younger brother J. D., and all the other kids in Adenville, Tom hasn't changed a bit. The Great Brain is back one more time, and he's at the top of his form with his money-making schemes and getting into big trouble. As always, life is more exciting when this brain's around!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wjViDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:f,published:b,publisher:c,subtitle:d}},{id:7096,attributes:{title:"More Adventures of the Great Brain",description:"This second book in the series is a great combination of The Adventures of Tom Sawyer and The Terrible Two series, and is perfect for fans of Roald Dahl. Has Tom, a.k.a. the Great Brain, given up his con-artist ways for a bicycle? Not for long. Soon the Great Brain is back to his old tricks, swindling and trading, and even convincing the whole town there's a prehistoric monster on the loose. But when someone robs the bank, even the police are stumped. Can the Great Brain solve the crime and put the crooks behind bars?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gThiDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:f,published:b,publisher:c,subtitle:d}}]}}},meta:{}}},prerenderedAt:1681377336882}}("John D. Fitzgerald","2017-01-10","Penguin","","movie",null,"series",1,"The Great Brain"))